import React from 'react';
import { Container, Anchor  } from 'react-bootstrap';
//import './styles.css'

function Rodape() {
  
  return (
        <Container>
          <Anchor className="roda"  href="/paginas/home">Redes Sociais</Anchor>
          <Anchor className="roda"  href="/paginas/contatos">Reservas</Anchor>
          <Anchor className="roda"  href="/paginas/intranet">WhatsApp</Anchor>
        </Container>
         
  );
}

export default Rodape;
